import "./Header.css"
import { MdOutlineLogin, MdOutlineLogout } from 'react-icons/md';

function Header() {
    return (
        <div id="header">
            <b>
                409 Labs
            </b>
            <div>
                {sessionStorage.getItem("token") !== null ? 
                    <MdOutlineLogout/>
                 : 
                 <MdOutlineLogin/>
                 }
            </div>
        </div>
    )
}

export default Header;
